import { makeStyles } from '@material-ui/core/styles';

export default makeStyles((theme) => ({
  root: {
    width: '100%',
    maxWidth: 1280,
    marginTop: theme.spacing(3),
    marginLeft: 'auto',
    marginRight: 'auto',
  },
  card: {
    height: 250,
    width: '100%',
    maxWidth: 350,
    marginLeft: 'auto',
    marginRight: 'auto',
  },
  content: {
    height: '100%',
  },
  titulo: {
    color: '#303f9f',
    textAlign: 'center',
  },
  subtitulo: {
    color: 'gray',
    textAlign: 'center',
  },
  registro: {
    display: 'block',
    width: '100%',
    height: '100%',
    justifyContent: 'center',
    alignItems: 'center',
    textAlign: 'center',
  },
  labelreg: {
    color: 'gray',
    textTransform: 'uppercase',
  },
  iconreg: {
    display: 'block',
    fontSize: 50,
  }
}))
